switch (args.plainTexts[0]) {
	case "fortification_on":
	case "fortification_off":
	case "acc_on":
	case "acc_off":
		var token = await loadToken();
		if (!token[0])
			var token = await loadToken(true);
		var actionJson = await action(args.plainTexts, token[1]);
		if (!actionJson[0])
			token = await loadToken(true);
		return actionJson[1];
	case "acc_toggle":
		await loadNiuData()
		var command = "acc_off";
		if (info_data.scooter_state == "fortification_on" || info_data.scooter_state == "acc_off")
			command = "acc_on";

		var token = await loadToken();
		if (!token[0])
			var token = await loadToken(true);
		var actionJson = await action(command, token[1]);
		if (!actionJson[0])
			token = await loadToken(true);
		return actionJson[1];
	case "scooter_info":
		await loadNiuData()
		const address = await Location.reverseGeocode(info_data.latitude, info_data.longitude);
		var location_text = address[0].name;

		return `
GPS: ${info_data.gps}
GSM: ${info_data.gsm}
估计里程: ${info_data.battery_range}KM
电池电量: ${info_data.usable_battery_level}％
中控电量: ${info_data.centre_battery_level}％
车辆位置: ${location_text}`;
	case undefined:
		let response = await loadNiuData()
		if (config.runsInAccessoryWidget)
		{
			let widget = await createLockScreenWidget(info_data.usable_battery_level);
			widget.presentAccessoryCircular() // Does not present correctly
			Script.setWidget(widget);
			Script.complete();
		}
		else
		{
			if (response == "ok") {
				addMapArea();
				addLastTrackMapArea();
				let widget = await createWidget(info_data, colors);
				Script.setWidget(widget);
				presentWidget(widget);
				Script.complete();
			} else {
				let widget = errorWidget(response);
				Script.setWidget(widget);
				presentWidget(widget);
				Script.complete();
			}
		}
		break;
	default:
		let widget = errorWidget("Unknown args: " + args.plainTexts);
		Script.setWidget(widget);
		presentWidget(widget);
		Script.complete();
}
